Brandi is going out of town on business and needs her Princess looked after. The kid at the dog hotel sends to get her, and is definitely not a dog person. As she finishes packing, Jordan is struggling to accommodate the dogs belongings and eccentricities. She rushes in to stop Jordan before he manhandles her pet, and when he tells her that he just needed a job and doesn't even like dogs, Brandi decides she needs to teach this kid some finesse. No better way to get someone to be more sentimental then a fantastic blowjob!
